var formattedEvents = [];
var eventObj = {};
eventObj.event_object_id = events.id;
eventObj.event_date = new Date().toISOString();

var webhook_type = events.action.split(".");
var object_type = webhook_type[0];
if (object_type === 'appointment') {
    eventObj.event_object_type = 'appointments';
}
var event_type = webhook_type[1];

switch (event_type) {
    case 'scheduled': 
    	eventObj.event_type = 'CREATED';
    break;
    case 'rescheduled':
    	eventObj.event_type = 'MOVED';
    break;
    case 'canceled':
    	eventObj.event_type = 'DELETED';
    break;
    case 'changed':
    	eventObj.event_type = 'UPDATED';
    break;
    default:
    eventObj.event_type = 'UNKNOWN';
}

formattedEvents.push(eventObj);
done({
    "events": formattedEvents
});

if(!response_iserror){
var body = {};
  done({
  "response_body": body
  });
}
done();

if (!response_iserror) {
  var response = {};
  response['endpoint'] = 'acuityscheduling';
  response['dateTime'] = new Date();
  response['valid'] = 'true';
  done({
   "response_body": response
  });
}

done({
"continue":true
})

var response = response_body_map || response_body;
var configs = {};
if (!response_iserror) {
    if (response.id)
        configs['webhooks.appointments.cancel'] = response['id'];

    done({
        "configuration": configs
    });
}
done();

